export const signUpUser = () => {
    try {
        return fetch('http://localhost:3000/api/signup', {
            method:'POST',
            mode: 'cors',
            cache: "no-cache",
            url: 'http://localhost:3000',
            headers: {
                "Content-Type": "application/json",
            },
            body: JSON.stringify(assoc('roles', ['user'], values))
        })
    } catch(err) {
        throw Error(err);
    }
}
